import React from 'react'

const Task = ( {task} ) => {
    return (
        <div className='task'>
            <h3>{task.text}</h3>
            <p>{task.day}</p>
        </div>
    )
}
//Individual element gets passed in from Tasks.js and text and day gets returned back up

export default Task
